campaignTrail_temp.questions_json = JSON.parse("[{\"model\": \"campaign_trail.question\", \"pk\": 717, \"fields\": {\"priority\": 1, \"description\": \"August 2019: It’s more than two years until the federal election. However, European elections just happened and the SPD has suffered disastrous losses. This prompted the party leader, Andrea Nahles, to resign. Now, the party members should vote for a new party leader. You have just declared your candidacy, together with Klara Geywitz. How do you want to convince the party members to vote for you?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 718, \"fields\": {\"priority\": 1, \"description\": \"November 2019: One condition the SPD had for entering the Grand coalition was that there would be an evaluation at half-time. The time for that is now - as Vice Chancellor, you have some input. Are you satisfied with what the Grand coalition has achieved so far?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 719, \"fields\": {\"priority\": 1, \"description\": \"July 2020: It’s more than a year until the federal election, though there are talks that the SPD already wants to nominate a chancellor candidate. You and Rolf Mützenich, the leader of the parliamentary group, are the names that are mentioned most often. The party leadership has invited you to talk to them - how do you want to convince them that you are the right person?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 720, \"fields\": {\"priority\": 1, \"description\": \"August 2020: Congratulations -  despite losing the race for SPD leadership, the party has just nominated you as their chancellor candidate. The SPD is polling in third place, and while it will be a while until the campaign starts properly, few people believe you can turn it around. What will your strategy in the coming months be?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 721, \"fields\": {\"priority\": 1, \"description\": \"One topic that has been part of the political discourse in the last years is the minimum wage, which was introduced in 2015. Currently, it is 9.35€, with a non-political commission deciding when it will be adjusted. Do you want to promise changes for the election?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 722, \"fields\": {\"priority\": 1, \"description\": \"March 2021: During the winter, the country was gripped by the Covid pandemic and strict lockdowns were mandated. Now, the country is slowly starting to open up. You can either voice your opinion on the openings or focus more on your role as Finance Minister during this time.\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 723, \"fields\": {\"priority\": 1, \"description\": \"Soon, the election campaign is going to begin properly. The CDU lost some support due to some of their MPs selling overpriced medical masks, but unfortunately, the SPD barely profited from that. In the run-up to the campaign, you’ve leaned into your moderate image - is that something you want to continue?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 724, \"fields\": {\"priority\": 1, \"description\": \"April 2021: In 2020, the financial payment provider Wirecard went bankrupt after massive fraud was discovered. There are allegations that a government agency that is under your responsibility as Finance Minister did a bad job and should have intervened earlier. Today, you have to talk to a parliamentary committee of inquiry about your role in this affair.\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 725, \"fields\": {\"priority\": 1, \"description\": \"The CDU/CSU has selected Armin Laschet as their chancellor candidate after a bruising nomination battle. Meanwhile, the Green Party selected Annalena Baerbock in a much smoother selection. Both of them are way ahead of you in the polls - what’s your strategy regarding them?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 726, \"fields\": {\"priority\": 1, \"description\": \"A topic that comes up from time to time during this election season is the relationship with both Nato and Russia. Gerhard Schröder, former chancellor and SPD member, is criticized for his close ties to Putin. Do you have anything to say about this?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 727, \"fields\": {\"priority\": 1, \"description\": \"May 2021: The Federal Constitutional Court just ruled the Climate Protection Act unconstitutional and demands the government do more to lower emissions. The federal government in Berlin is now working on making the law stricter. As Vice Chancellor, you can contribute to the new law.\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 728, \"fields\": {\"priority\": 1, \"description\": \"Tax policy is an important topic in every election and this one is no exception. Broadly, parties on the right of the political spectrum have called for lower taxes across the board, while the more leftwing parties want to raise taxes on the rich. How do you want to position the SPD?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 729, \"fields\": {\"priority\": 1, \"description\": \"Digitalization is an important topic in this election, with all parties unveiling plans for how to move forward with this. What is the plan of the SPD?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 730, \"fields\": {\"priority\": 1, \"description\": \"June 2021: The parliamentary commission investigating Wirecard has finished its job and created a report. In it, you are not directly implicated, and how much you are blamed depends mostly on the party of the person asked. During the debate about this in the Bundestag, how do you want to present yourself?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 731, \"fields\": {\"priority\": 1, \"description\": \"Since 2005, long-time unemployed people in Germany get money from the state at the subsistence level, the so-called Hartz IV. However, they receive less money if they are not looking for a job. Many people are not happy with this system - what does the SPD want to change?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 732, \"fields\": {\"priority\": 1, \"description\": \"Widespread flooding is affecting large areas of western, southern and middle Germany. Other politicians, like Laschet, are travelling to the affected areas. Do you want to go there too?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 733, \"fields\": {\"priority\": 1, \"description\": \"After the devastating floodings, climate change is once again a much-discussed topic in the media and politics. You are expected to make a statement on this topic, did this catastrophe affect your stance?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 734, \"fields\": {\"priority\": 1, \"description\": \"After early successes, the vaccination campaign has become sluggish in recent weeks. Some politicians are going so far as to demand making the vaccine mandatory.\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 735, \"fields\": {\"priority\": 1, \"description\": \"August 2021: When you were nominated as chancellor candidate almost a year ago, your campaign seemed hopeless. Now, after missteps by both of your opponents, your position in the polls has improved significantly, while both the Greens and the CDU struggle. How do you want to capitalize on this?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 736, \"fields\": {\"priority\": 1, \"description\": \"The election is in about a month now, and as usual, there will most probably be a coalition government afterwards. Which parties do you want to talk to?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 737, \"fields\": {\"priority\": 1, \"description\": \"Pictures of the disastrous retreat of NATO troops from Afghanistan go around the globe. The government is sharply criticised for its botched evacuation. What do you want to emphasize in this situation?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 738, \"fields\": {\"priority\": 1, \"description\": \"September 2021: Both the Finance Ministry led by you and the Justice Ministry let by a party colleague have just been searched by the police. The search was due to investigations into these agencies helping cover up money laundering. You’ve promptly been criticised for not having your own ministry in order.\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 739, \"fields\": {\"priority\": 1, \"description\": \"For the first time in German history, a Green Party candidate has been invited to the chancellor debate. In another first, the debate will be three-way, between you, Olaf Scholz of the SPD and Armin Laschet of the CDU. Who do you want to focus on?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 740, \"fields\": {\"priority\": 1, \"description\": \"During the Triell, you decided on Armin Laschet, Minister-President of North Rhine-Westphalia and chancellor candidate of the CDU. How do you want to attack him?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 741, \"fields\": {\"priority\": 1, \"description\": \"It’s the final few days of the campaign now, with election night just around the corner. Who do you want to campaign with during these last few days?\", \"likelihood\": 1.0}}]");
extraQuestions = JSON.parse("[{\"model\": \"campaign_trail.question\", \"pk\": 742, \"fields\": {\"priority\": 1, \"description\": \"November 2020: One condition the SPD had for entering the Grand coalition was that there would be an evaluation at half-time. Since even you are expressing a desire for more left-wing policies, there are some speculations that the Grand coalition might not survive. As Vice Chancellor, you can help shape this report - what do you want to put in?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 743, \"fields\": {\"priority\": 1, \"description\": \"Soon, the election campaign is going to begin properly. The CDU lost some support due to some of their MPs selling overpriced medical masks, but unfortunately, the SPD barely profited from that. In the run-up to the campaign, you’ve vacillated between leaning into your moderate image and appealing to the left wing. What’s your strategy for the campaign?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 744, \"fields\": {\"priority\": 1, \"description\": \"Soon, the election campaign is going to begin properly. The CDU lost some support due to some of their MPs selling overpriced medical masks, but unfortunately, the SPD barely profited from that. In the runup to the campaign, you’ve been surprisingly leftist with your rhetoric - is this something you want to keep up?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 745, \"fields\": {\"priority\": 1, \"description\": \"June 2021: The parliamentary commission investigating Wirecard has finished its job and created a report. You didn’t get clearly implicated, but with the help of the E-Mails you turned over, it’s undeniable that you and your ministry made mistakes. During the debate about this in the Bundestag, how do you want to present yourself?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 746, \"fields\": {\"priority\": 1, \"description\": \"When you were nominated as chancellor candidate almost a year ago, your campaign seemed hopeless. Now, despite missteps by both of your opponents, you are still quite a bit behind. Do you have a strategy to turn this campaign around in the final weeks?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 747, \"fields\": {\"priority\": 1, \"description\": \"During the Triell, you decided on Annalena Baerbock, party leader and chancellor candidate of the Green Party. How do you want to attack her?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 748, \"fields\": {\"priority\": 1, \"description\": \"During the Triell, you’ve decided to present yourself as calm and collected without focusing on an opponent. How do you want to do that?\", \"likelihood\": 1.0}}]");
campaignTrail_temp.answers_json = JSON.parse("[{\"model\": \"campaign_trail.answer\", \"pk\": 4000, \"fields\": {\"question\": 717, \"description\": \"The party needs to be reinvigorated, and we need to return to our Social Democratic roots for that. We need new answers, a vision for progress and action on the issues, like climate change or the wealth gap. One can only notice how the CDU's politics lies like mildew over the republic.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4001, \"fields\": {\"question\": 717, \"description\": \"In the last few years, the party has lost the trust of many voters. We need to win it back, which means finding Social Democratic answers to the questions of our time. For this, all wings of our party need to be unified. I stand for a confident SPD that dares to do something.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4002, \"fields\": {\"question\": 717, \"description\": \"I’m the candidate in this election who stands for the continuation of the Grand coalition. There’s a lot we have achieved together, and I believe it’s in the best interest of the SPD to keep doing what we’re doing. Agreeable Policies, good compromises and a good working relationship with the CDU/CSU is needed to bring this country forward.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4003, \"fields\": {\"question\": 717, \"description\": \"I’m the incumbent Vice Chancellor and Finance Minister of Germany - none of the other candidates has my name recognition. I’ll focus less on policy specifics and trust that being the most well-known candidate will carry me to victory. I can lead this party with the dignity it deserves.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4004, \"fields\": {\"question\": 718, \"description\": \"Overall, we are satisfied. We’ve finished about a third of the projects we wanted to do according to the coalition agreement and a lot more are currently on the way, like stable pension levels or the ‘Good-Daycare-Law’. We are on a good path.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4005, \"fields\": {\"question\": 718, \"description\": \"We have made good progress on a lot of projects, for example widening the Mother's pension, and definitively want to continue the coalition until the end of the term, yes. However, after the next election, the country needs a new government without CDU and CSU!\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4006, \"fields\": {\"question\": 718, \"description\": \"Frankly, we can’t be satisfied with the last one and a half years. It’s simply not possible to pass what we need while governing with the CDU/CSU and I don’t know if it’s a good idea to continue this coalition.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4007, \"fields\": {\"question\": 718, \"description\": \"I am completely satisfied, yes. We are good governing partners and I’m looking forward to further cooperation - perhaps also after the next election. We've enacted good legislation - and everyone wantin to exit this coalition has to ask themself, if we could enact these measures from the opposition.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4008, \"fields\": {\"question\": 719, \"description\": \"I see the writing on the wall -  I lost the leadership election to two politicians that are more leftwing than me. Therefore, I’ll promise to run a more leftwing campaign when nominated as chancellor candidate.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4009, \"fields\": {\"question\": 719, \"description\": \"They know who I am and what I stand for. While I recognize that the left wing of the party is a significant force, I won’t fundamentally change who I am and run a campaign that’s not too leftist.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4010, \"fields\": {\"question\": 719, \"description\": \"They know who I am and what I stand for. While I recognize that the left wing of the party is a significant force, I won’t fundamentally change who I am and run a campaign that’s not too leftist.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4011, \"fields\": {\"question\": 719, \"description\": \"I’m the most electable candidate, without me, the situation for the SPD will be even more hopeless than it already is. If we want to have an even small chance at winning, they have to nominate me, ideology be damned.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4012, \"fields\": {\"question\": 720, \"description\": \"I lost the leadership election because the left wing of the party was suspicious of me. In the coming months, I want to earn their trust and promise to lead the SPD on a more left-wing course.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4013, \"fields\": {\"question\": 720, \"description\": \"My biggest asset is my competent persona. I don’t want to get into policy specifics right now, instead, I want to present myself as a capable leader. Being Vice Chancellor and Finance Minister should make that easier.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4014, \"fields\": {\"question\": 720, \"description\": \"I’ve always been part of the party's moderate wing, and this is not something I’m going to hide. The centrist course of the SPD is correct and will lead us to victory next year.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4015, \"fields\": {\"question\": 720, \"description\": \"We are far behind in the polls right now, and the only way to make up this difference is by running an aggressive campaign. I’ll attack both the CDU and the Greens.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4016, \"fields\": {\"question\": 721, \"description\": \"The minimum wage is not high enough for the hard-working people in this country. It has to be raised to 14€. Anything less is simply not enough to fully participate in our society.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4017, \"fields\": {\"question\": 721, \"description\": \"Our current minimum wage is not enough. That’s why we propose to raise it to 12€, which would help low-income earners significantly.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4018, \"fields\": {\"question\": 721, \"description\": \"The minimum wage commission has been doing a good job in the past, and it would not be right to say a number here just to win votes. We want to keep the system as it is.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4019, \"fields\": {\"question\": 721, \"description\": \"The minimum wage has to be raised by more than the commission would. I don’t want to give a number here - the exact number depends on a lot of factors, so it’s better to decide later.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4020, \"fields\": {\"question\": 722, \"description\": \"During the winter, the lockdowns were needed, and we have to be careful not to open up to quickly. Our opening strategy and vaccination campaign should make it possible for people to go to beer gardens in the summer.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4021, \"fields\": {\"question\": 722, \"description\": \"I want to use this as an opportunity to attack Laschet, the party leader of the CDU. His proposed “bridge lockdown” is confusing and North Rhine-Westphalia, the state governed by him, is not doing enough to slow down the spread.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4022, \"fields\": {\"question\": 722, \"description\": \"As Finance Minister, I have been responsible for the help our economy received during these difficult times. Now, I will call for additional financial help for people affected by the lockdowns. The culture industry - museums, theatres, cinemas and the like - especially need help.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4023, \"fields\": {\"question\": 722, \"description\": \"It’s fiscally irresponsible to give out even more government aid than we already have. I’m worried about the national debt and inflation down the line - the aid we have already given out is enough.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4024, \"fields\": {\"question\": 723, \"description\": \"Yes - there are many voters in the centre of the political spectrum who are looking for an alternative to the CDU. I will present myself as the option for them.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4025, \"fields\": {\"question\": 723, \"description\": \"Broadly, I want to lean into my personal moderation and similar political style to Merkel. However, I will also emphasize some of the more leftist points in our program.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4026, \"fields\": {\"question\": 723, \"description\": \"Actually, it seems that the country wants a more leftist government than we’ve had in the past decade. Therefore, I’ll abandon my moderate image and run a more leftist campaign.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4027, \"fields\": {\"question\": 724, \"description\": \"I will fight back hard against the allegations today. It’s a complete fairytale that the Finance Ministry protected Wirecard. We did our job just fine, no one could have foreseen this massive fraud.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4028, \"fields\": {\"question\": 724, \"description\": \"We need to get to the bottom of this together - I promise to fully cooperate with the committee and turn over any E-Mails I might have missed in the past. Still, I maintain that the Finance Ministry is not to blame here.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4029, \"fields\": {\"question\": 724, \"description\": \"Deflect as much as possible! I will give nothing but the shortest possible answers, this whole committee is a political witchhunt by the opposition anyway!\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4030, \"fields\": {\"question\": 724, \"description\": \"Many people had their part in this unfortunate affair, and part of the fault lies with the behaviour of the Finance Ministry. I’m sorry that this happened under my watch and promise to help investigate how it came this far.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4031, \"fields\": {\"question\": 725, \"description\": \"Let’s be honest, neither of them should become chancellor. Laschet simply doesn’t have the temperament to lead the country, Baerbock is too young and inexperienced. I’m a more capable leader.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4032, \"fields\": {\"question\": 725, \"description\": \"This is a good opportunity to go on the attack. Specifically, I want to call out Laschet - not even his own party is fully behind him and his recent Covid strategy in North Rhine-Westphalia was embarrassing.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4033, \"fields\": {\"question\": 725, \"description\": \"This is a good opportunity to go on the attack. Specifically, I want to call out Baerbock. She has never been part of the federal or even a state government before. This country needs a steady hand, not someone as unproven as her.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4034, \"fields\": {\"question\": 725, \"description\": \"I want to congratulate both of them on getting nominated. I’m looking forward to a fair election campaign between the three of us!\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4035, \"fields\": {\"question\": 726, \"description\": \"The SPD is committed to NATO, which guarantees the security of Europe. We also want to strengthen our cooperation with other European countries in military questions, especially France.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4036, \"fields\": {\"question\": 726, \"description\": \"Schröder is no active politician anymore and is free to do whatever he wants to. We also have business interests regarding Russia - for example, the Nord-Stream 2 pipeline that will open next year and is very important for our energy supply.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4037, \"fields\": {\"question\": 726, \"description\": \"The SPD has always been the party in favour of easing tensions with the East. We need to keep talking to Putin, and former chancellor Schröder could help us with his good connections.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4038, \"fields\": {\"question\": 726, \"description\": \"Our current policy towards Russia has not been tough enough. Schröder should either cut ties with Russia or leave the SPD. Putin cannot be trusted and we should only open Nord-Stream 2 if we get concessions from him.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4039, \"fields\": {\"question\": 727, \"description\": \"We should quickly write a new Climate Protection Act that is ambitious, yet feasible - for example, being carbon neutral by 2045 should be the goal. It’s important that we pass this law quickly, so it should be written in a way that both the SPD and CDU can support it.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4040, \"fields\": {\"question\": 727, \"description\": \"We can now quickly correct the mistakes we made when writing the original version of this law. The CDU has stopped exactly the things the constitutional court ruled unlawful, I hope they will be more sensible this time.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4041, \"fields\": {\"question\": 727, \"description\": \"This is a great opportunity to pass a truly ambitious law that does enough to combat climate change. We need to put in the goal to become carbon neutral by 2040, now is not the time for slowing down.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4042, \"fields\": {\"question\": 727, \"description\": \"The court mandated that the law should be changed by the end of 2022. We should wait until after the election, this is a job better suited for the new government.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4043, \"fields\": {\"question\": 728, \"description\": \"There need to be some corrections with our taxation system - higher income earners need to pay more, while low income should have to pay less. We shouldn’t change anything too radical though.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4044, \"fields\": {\"question\": 728, \"description\": \"Some minor adjustments are needed, but we don’t want to rock the boat here. Overall, taxes for the rich will be raised a bit to finance additional investments and some systems like the Soli should be reworked.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4045, \"fields\": {\"question\": 728, \"description\": \"A lot of these other programs, especially the ones from the CDU and FDP, would make the state get way less money in taxes. Since we need both investments in the future and fiscal stability, we can’t lower taxes like they promise. Instead, there needs to be a modest tax increase for high-income earners.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4046, \"fields\": {\"question\": 728, \"description\": \"We need to do a big overhaul of our taxation system so it truly benefits the people. Much higher taxes for very high-income earners, a moderate decrease for low-income earners and a wealth tax are all needed.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4047, \"fields\": {\"question\": 729, \"description\": \"One thing we need to focus on here is digitalization in schools. We have learned some lessons during the pandemic and subsequent lockdowns. Every child needs access to the internet and an internet-capable device.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4048, \"fields\": {\"question\": 729, \"description\": \"Access to the internet is an important right in this day and age. Every household in Germany needs access to a fast and reliable internet connection.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4049, \"fields\": {\"question\": 729, \"description\": \"The dominance of big American internet companies is not good for Germany. We need to find German and European solutions and help local online shops to compete.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4050, \"fields\": {\"question\": 729, \"description\": \"We need to move forward with digitalization in government agencies, schools and the administration.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4051, \"fields\": {\"question\": 730, \"description\": \"All this will blow over in a couple of days. I’ll let them criticize me, let other members of my party defend me and just wait this out.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4052, \"fields\": {\"question\": 730, \"description\": \"It’s obvious that these attacks on me are nothing but a cheap political ploy. There’s no clear evidence of any wrongdoing by me and I will fight back passionately against these allegations!\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4053, \"fields\": {\"question\": 730, \"description\": \"It’s obvious someone has to resign over this, and it won’t be me. Jörg Kukies, the State Secretary serving under me in the Finance Ministry will be fired over this.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4054, \"fields\": {\"question\": 731, \"description\": \"Hartz IV has to be replaced by something else we call citizen money. There will be fewer sanctions for people not actively looking for work and less bureaucracy.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4055, \"fields\": {\"question\": 731, \"description\": \"The whole system needs to be reformed from the ground up. There should be no more sanctions for people not actively looking for work, at least 100€ more paid out per person per month and the burocracy of the system will be significantly reduced.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4056, \"fields\": {\"question\": 731, \"description\": \"The SPD created the Hartz IV system, and while there are some parts of it that should be tweaked, we stand by it overall.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4057, \"fields\": {\"question\": 731, \"description\": \"People receiving Hartz IV have struggled a lot during the Covid pandemic. That’s why we’re in favour of a larger one-time payment for them to help them get by in these difficult times.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4058, \"fields\": {\"question\": 732, \"description\": \"No, I don’t want to be seen as politicizing this catastrophe. Instead, I want to focus on my role as Finance Minister and promise quick, unbureaucratic financial aid to the affected regions.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4059, \"fields\": {\"question\": 732, \"description\": \"Yes, I want to go there, and talk to some affected people. However, I don’t want to do this in front of cameras, I’m not doing this for the media attention.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4060, \"fields\": {\"question\": 732, \"description\": \"I will travel to the affected areas and promise them federal, financial help. The government will help to fix the problems that can be fixed with money.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4061, \"fields\": {\"question\": 732, \"description\": \"Of course, I will travel there, and show myself as a man of action, with rubber boots and shovels!\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4062, \"fields\": {\"question\": 733, \"description\": \"There’s no doubt that man-made climate change has something to do with this catastrophe. This needs to be a motivation to do even more to combat climate change!\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4063, \"fields\": {\"question\": 733, \"description\": \"The flooding has shown us that we need to do more to combat climate change, yes. However, helping the affected people and getting them the financial aid they need has a higher priority now.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4064, \"fields\": {\"question\": 733, \"description\": \"It’s clear that we need a way more ambitious climate program. A higher price for carbon and stricter emission targets should not be off the table - alongside measures to protect people from disasters like this.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4065, \"fields\": {\"question\": 733, \"description\": \"Laschet said that because of a day like this, you don’t change politics, and I have to agree. While we have to evaluate if there’s anything we need to do, let’s not make hasty decisions.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4066, \"fields\": {\"question\": 734, \"description\": \"We need to do whatever we can to convince unvaccinated people to get the vaccine, even if that means offering a Bratwurst as a bonus when you get vaccinated. I’m against mandatory vaccinations though.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4067, \"fields\": {\"question\": 734, \"description\": \"There needs to be stronger incentives to get vaccinated. I’m advocating for making Covid tests no longer free - if the unvaccinated want to go to the restaurant for example, they’ll need to pay to get tested beforehand.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4068, \"fields\": {\"question\": 734, \"description\": \"I agree, if there’s not a significant uptick in vaccinations in the coming months, we need to think about making the mandatory. It’s something to look into in the coming weeks.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4069, \"fields\": {\"question\": 734, \"description\": \"It’s a personal decision if someone wants to get vaccinated or not. We shouldn’t discriminate against people who don’t want the vaccination and don’t waste too much money on this vaccination campaign.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4070, \"fields\": {\"question\": 735, \"description\": \"Baerbock seems like the more vulnerable opponent, and a lot of her voters are looking to a centre-left alternative to her. I will present myself as a good choice and the man who can beat Laschet to them.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4071, \"fields\": {\"question\": 735, \"description\": \"It seems better to go after Laschet voters - he lost some after his flooding gaffe and this is a good opportunity to remind voters that I would be a much better chancellor than him.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4072, \"fields\": {\"question\": 735, \"description\": \"There’s no need to attack either of them. I will simply keep doing what I’m doing, show myself as the calm, competent alternative, and voters will come to me.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4073, \"fields\": {\"question\": 735, \"description\": \"Both Laschet and Baerbock have shown there incompetence in the past weeks and frankly disqualiefied themselves in this race. I’ll go on the attack and will call out their failings at every opportunity.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4074, \"fields\": {\"question\": 736, \"description\": \"There’s only one coalition that can both get a majority and bring true, left change to this country: A Red-Red-Green coalition with the SPD, Greens and Left party.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4075, \"fields\": {\"question\": 736, \"description\": \"My favourite coalition would be Red-Green. If that has no majority, we’ll have to see how we can best for a government.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4076, \"fields\": {\"question\": 736, \"description\": \"One thing is clear - this Grand coalition of the past eight years can’t continue. We need to find majorities beyond it.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4077, \"fields\": {\"question\": 736, \"description\": \"While I don’t want to rule out something completely, it’s hard to see how a coalition with the Left party would work if they don’t significantly change some of their views, especially on NATO.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4078, \"fields\": {\"question\": 737, \"description\": \"The situation in Afghanistan right now is depressing, much that we fought for is being destroyed. We need to assess how it could come this far.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4079, \"fields\": {\"question\": 737, \"description\": \"We can’t let people alone as we have in the past. Endangered people have to be brought to Germany or supported in countries neighbouring Afghanistan.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4080, \"fields\": {\"question\": 737, \"description\": \"The CDU has started to blame Foreign Minister Maas, even though the Ministry of Defence under CDU politician Kramp-Karrenbauer is really to blame. Voters have to see through this attempt to slander the SPD!\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4081, \"fields\": {\"question\": 737, \"description\": \"I admit that the government has made mistakes, Foreign Minister Maas included. We shouldn’t spend time on the blame game now though and instead see how we can help people!\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4082, \"fields\": {\"question\": 738, \"description\": \"The public attorneys could have just sent a written request for information. This search was unnecessary and excessive.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4083, \"fields\": {\"question\": 738, \"description\": \"I refuse to comment on this. The police search wasn’t related to any of my actions and I don’t want to give this story any oxygen.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4084, \"fields\": {\"question\": 738, \"description\": \"This is all part of a political witchhunt! First the Wirecard investigation, now this, someone is trying to keep me from becoming chancellor!\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4085, \"fields\": {\"question\": 738, \"description\": \"The problems with the specific part of the ministry that’s being investigated already started when it was still led by the CDU. I don’t have a part in this, it’s not my fault this happened.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4086, \"fields\": {\"question\": 739, \"description\": \"Laschet seems like the more dangerous opponent, so I will focus on him.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4087, \"fields\": {\"question\": 739, \"description\": \"It will be easier to win over voters from Baerbock, so focusing on her is better.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4088, \"fields\": {\"question\": 739, \"description\": \"I want to present myself as calm and composed. Let them attack me and each other, I won’t be baited.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4089, \"fields\": {\"question\": 739, \"description\": \"Actually, I don’t want to give them an opportunity to attack me. I won’t participate in this Triell!\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4090, \"fields\": {\"question\": 740, \"description\": \"His gaffe during the visit after the flooding and some strange statements he’s made show that he just doesn’t have the temperament to be chancellor. I’m much better suited to lead this country.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4091, \"fields\": {\"question\": 740, \"description\": \"The proposals of his party are just not what this country needs. Be it taxes, minimum wage or Hartz IV, the SPD has the better program for the common man.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4092, \"fields\": {\"question\": 740, \"description\": \"Laschet has no real solutions for climate change. Especially after the flooding in the summer, it’s irresponsible to do as little as he proposes.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4093, \"fields\": {\"question\": 740, \"description\": \"Actually, I’ve changed my mind. I’m just going to present myself as calm and above petty attacks.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4094, \"fields\": {\"question\": 741, \"description\": \"Franziska Giffey and Manuela Schwesig are trying to win the state elections for the SPD in Berlin and Mecklenburg-Vorpommern respectively. I want to campaign with them to give them a boost!\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4095, \"fields\": {\"question\": 741, \"description\": \"Kevin Kühnert, former leader of our youth wing, is very popular among young and leftwing people. I want to campaign with him.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4096, \"fields\": {\"question\": 741, \"description\": \"I want to campaign with the leaders of our party, Saskia Esken and Norbert Walter-Borjans. To win this, the whole SPD has to come together!\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4097, \"fields\": {\"question\": 741, \"description\": \"It’s a bit unconventional, but despite being from a different party, I share many similarities with the outgoing chancellor Angela Merkel. She won’t campaign for me, but let’s try to get to appear her at an event with me.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4098, \"fields\": {\"question\": 742, \"description\": \"Despite some misgivings, we can be satisfied overall. We’ve finished about a third of the projects we wanted to do according to the coalition agreement and a lot more are currently on the way. We are on a good path.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4099, \"fields\": {\"question\": 742, \"description\": \"We have made progress on a lot of projects and want to continue the coalition until the end of the term, it would be irresponsible to let the government collapse now. However, after the next election, the country needs a new government!\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4100, \"fields\": {\"question\": 742, \"description\": \"Frankly, we can’t be satisfied with the last one and a half years. It’s simply not possible to pass what we need while governing with the CDU/CSU and I don’t know if it’s a good idea to continue this coalition.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4101, \"fields\": {\"question\": 742, \"description\": \"I am almost completely satisfied, yes. We are good governing partners and I’m looking forward to further cooperation - perhaps also after the next election.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4102, \"fields\": {\"question\": 743, \"description\": \"I needed to triangulate to become chancellor candidate - now that the campaign is starting, I’ll fully return to my image as moderate\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4103, \"fields\": {\"question\": 743, \"description\": \"This was deliberate, and I want to continue this strategy. Broadly, I want to lean into my personal moderation and similar political style to Merkel. However, I will also emphasize some of the more leftist points in our program.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4104, \"fields\": {\"question\": 743, \"description\": \"I’ve leaned into it a bit before, but now it’s time to fully move to the left. I will abandon my moderate image fully to run a leftist campaign.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4105, \"fields\": {\"question\": 744, \"description\": \"That was something I had to do to win the candidacy - now, I want to return to my previous image of a sensible moderate.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4106, \"fields\": {\"question\": 744, \"description\": \"Partly, I want to keep this up, by leaning into our more leftist policy proposals. However, I also want to emphasize my personal moderate style and cast myself as a politician similar to Merkel.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4107, \"fields\": {\"question\": 744, \"description\": \"Of course! Time and time again, more moderate SPD candidates have lost against Merkel. To win, I want to present myself as the true, leftwing alternative for this country!\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4108, \"fields\": {\"question\": 745, \"description\": \"All this will blow over in a couple of days. I’ll let them criticize me, let other members of my party defend me and just wait this out.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4109, \"fields\": {\"question\": 745, \"description\": \"It’s obvious that these attacks on me are nothing but a cheap political ploy. There’s no clear evidence of any wrongdoing by me and I will fight back passionately against these allegations!\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4110, \"fields\": {\"question\": 745, \"description\": \"It’s obvious someone has to resign over this, and it won’t be me. Jörg Kukies, the State Secretary serving under me in the Finance Ministry will be fired over this.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4111, \"fields\": {\"question\": 746, \"description\": \"Baerbock seems like the more vulnerable opponent, and a lot of her voters are looking to a centre-left alternative to her. I will present myself as a good choice and the man who can beat Laschet to them.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4112, \"fields\": {\"question\": 746, \"description\": \"It seems better to go after Laschet voters - he lost some after his floofing gaffe and this is a good opportunity to remind voters that I would be a much better chancellor than him.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4113, \"fields\": {\"question\": 746, \"description\": \"There’s no need to attack either of them. I will simply keep doing what I’m doing, and show myself as the calm, competent alternative, and voters will come to me.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4114, \"fields\": {\"question\": 746, \"description\": \"Both Laschet and Baerbock have shown their incompetence in the past weeks and frankly disqualified themselves in this race. I’ll go on the attack and will call out their failings at every opportunity.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4115, \"fields\": {\"question\": 747, \"description\": \"She’s young, inexperienced and had a slew of scandals this summer. The German people need a better leader than her.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4116, \"fields\": {\"question\": 747, \"description\": \"Her party's proposals on social issues like the minimum wage and Hartz IV sound nice, but do you trust the Greens to deliver them? Especially in a coalition with the CDU?\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4117, \"fields\": {\"question\": 747, \"description\": \"The Green Party is nothing more than a single-issue party against climate change. While it’s an important issue, there are other important topics that her party doesn’t care about enough.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4118, \"fields\": {\"question\": 747, \"description\": \"Actually, I’ve changed my mind. I’m just going to present myself as calm and above petty attacks.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4119, \"fields\": {\"question\": 748, \"description\": \"I’m going to explicitly present myself as the natural continuation of the Merkel years. While we are from different parties, we are both moderate and known for our calmness.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4120, \"fields\": {\"question\": 748, \"description\": \"Leaning into my persona will be enough. I’ll just answer all of the questions in a calm way, won’t let myself get baited into heated exchanges and subtly emphasise my experience.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4121, \"fields\": {\"question\": 748, \"description\": \"The Social Democrats have always been the party fighting for the common man. I’ll put my emphasis on that, to contrast both against the CDU’s business interest and the Green Party’s elitism.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4122, \"fields\": {\"question\": 748, \"description\": \"Actually, screw this! I will attack them both whenever an opportunity presents itself. That way, I can sharpen my profile and show myself as the most competent candidate.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4123, \"fields\": {\"question\": 748, \"description\": \"This guaranteed pension level is a great achievement of the SPD. It shows that even in a Grand coalition, we are fighting for the little guy and achieving meaningful change.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4124, \"fields\": {\"question\": 748, \"description\": \"Right now, the usual age for getting pensions is 67. However, due to higher life expectancy and fewer young people, we need to raise it to 68 or 69.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4125, \"fields\": {\"question\": 748, \"description\": \"Our pension system needs to be streamlined. State employees, self-employed people and other exceptions should all use the same government pension insurance as normal employees instead of the complicated system we have now.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4126, \"fields\": {\"question\": 748, \"description\": \"We have to resist any impulse to raise the entry age for pensions beyond 67, guarantee the level of pensions or even raise it. The poverty of some pensioners is also something that needs to be combatted relentlessly.\"}}]");
