function executeWithRetry(fn, ...args) {
  const maxRetries = 20;
  const delayMs = 100;

  for (let retry = 0; retry < maxRetries; retry++) {
    try {
      fn(...args);
      return;
    } catch (err) {
      console.log(err);
      if (retry < maxRetries - 1) {
        setTimeout(() => {}, delayMs);
      }
    }
  }
}


